import math

def is_prime(num):
    if num <= 2:
        return False
    for i in range(2, int(math.sqrt(num)) + 1):
        if num % i == 0:
            return False
    return True

def generate_prime_pairs(nums):
    prime_pairs = []
    for i in range(len(nums)):
        for j in range(i + 1, len(nums)):
            if is_prime(nums[i] + nums[j]):
                prime_pairs.append((nums[i], nums[j]))
    return prime_pairs

